import React from 'react';
import { Data } from './Components/Data'; 

function App() {
    const products = Data(); 

    return (
        <div className='bg-gray-400'>
            <h1 className='text-center text-black text-[50px]'>CARTS</h1>
            {Array.isArray(products) && products.map((item, index) => (
                <div key={index} className='w-[250px] h-[250px] flex items-center justify-around flex-wrap bg-[blue-] m-2 p-2 rounded shadow'>
                    <img src={item.thumbnail} alt={item.title} className='w-full h-auto mb-2' /> Optional: Display product thumbnail
                    <span className='font-bold'>{item.title}</span>
                    <span className='text-gray-700'>${item.price.toFixed(1)}</span>
                    <span className='text-red-500'>Discounted Total: ${item.discountedTotal}</span>
                </div>
            ))}
        </div>
    );
}

export default App;
